import React from 'react';
import styles from './App.module.css';
import Header from './components/Header/Header.jsx';
import Navbar from './components/Navbar/Navbar.jsx';
import Post from './components/Post/Post.jsx';
import Publication from './components/Publication/Publication.jsx';

const App = () => {
  const post = {
    userPhoto: 'http://www.wpkixx.com/html/winku-dark/images/resources/friend-avatar10.jpg',
    userName: 'Janice Griffith',
    postData: 'June,2 2018 19:00 PM',
    description:
      "World's most beautiful car in Curabitur #test drive booking ! The most beautiful car available in america and the Saudia Arabia, you can book your test drive by our official Website.",
    amountView: 10,
    amountLike: 10,
    amountDislike: 10,
  };
  const props = {
    userPhoto: 'http://www.wpkixx.com/html/winku-dark/images/resources/admin2.jpg',
    boxDescription: 'write something',
    amountLike: 1,
  };

  function name(params) {
    params === { alina: 20 };
    if (params.alina === 2) {
      return 'good';
    }
  }
  name({ alina: 20 });

  const test = 1;
  return (
    <div className={styles.main}>
      <Header />
      <div className={styles.content}>
        <Navbar />
        <div>
          <Publication data={test} />
          <Post post={post} />
        </div>
      </div>
    </div>
  );
};

export default App;
